(() => {
  // --- CHANGE THIS if your news list node has a different name ---
  const SOURCE_NODE = "RSS Read";

  // 1) Get news items from the earlier node
  const newsItems = $items(SOURCE_NODE).map(i => i.json);

  // 2) Build the <li> list
  const listHtml = newsItems.map(j => {
    const title = j.title || j.link || "Article";
    const link  = j.link  || "#";
    const date  = j.pubDate || "";
    return `<li><a href="${link}">${title}</a> <small>â€” ${date}</small></li>`;
  }).join("");

  // 3) Grab LLM summary in a provider-agnostic way
  const summary =
    ($json && typeof $json.text === "string" ? $json.text : null) ||                // Gemini
    ($json && typeof $json.output === "string" ? $json.output : null) ||            // some nodes
    ($json && $json.choices && $json.choices[0] && $json.choices[0].message
         ? $json.choices[0].message.content : null) ||                              // OpenAI-style
    ($json && typeof $json.data === "string" ? $json.data : null) ||
    ($json && typeof $json.summary === "string" ? $json.summary : null) ||
    "";

  // 4) Return full HTML string
  return `<!doctype html>
<html><head>
<meta charset="utf-8" />
<style>
 body{font:14px/1.65 -apple-system,BlinkMacSystemFont,Segoe UI,Arial;color:#1f2937;margin:0}
 .hdr{background:#0f172a;color:#fff;padding:22px}
 .wrap{max-width:900px;margin:0 auto;padding:24px}
 h1{margin:0;font-size:22px}
 h2{margin:20px 0 8px}
 .card{background:#f8fafc;border:1px solid #e5e7eb;border-radius:10px;padding:16px}
 .list li{margin:6px 0}
 a{color:#2563eb;text-decoration:none}
 small{color:#6b7280}
</style>
</head><body>
 <div class="hdr">
   <h1>ðŸ“ˆ Weekly Market Intelligence â€” ${$now.format("MMM D, YYYY")}</h1>
 </div>
 <div class="wrap">
   <h2>Executive Brief</h2>
   <div class="card">
     ${summary}
   </div>

   <h2>Articles (last 7 days)</h2>
   <ol class="list">
     ${listHtml}
   </ol>
 </div>
</body></html>`;
})();
}}
